import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <div className='footer shadow footer-fixed mt-4' style={{ height:'1%', textAlign: 'center', alignContent: 'center', justifyContent: 'center' }}>
      <div className='footer-info mt-4'>
        COPYRIGHT 2023 WEBSITE - ALL RIGHTS RESERVED. PRIVACY POLICY
      </div>
    </div>
  )
}

export default Footer
